import React, {useEffect} from 'react';
import ReactDOM from 'react-dom/client';
import './styles/main.scss';
import App from './App';
import Navbar from './components/Navbar/Navbar';
import { ApolloClient, ApolloProvider, InMemoryCache } from '@apollo/client';


const root = ReactDOM.createRoot(document.getElementById('root'));

const client = new ApolloClient({
  uri: 'https://api.thegraph.com/subgraphs/name/uniswap/uniswap-v3',
  cache: new InMemoryCache(),
});

root.render(
  <ApolloProvider client={client}>
   <section className="section_top">
            <div className="section-container">
                <div className="section-layout-container container-medium with-padding">
                    <div className="section-layout">
                        <div className="gradient-area">
                            <div className="gradient-title-area">
                            <h1 className="text text-above section-title-1">sdvd</h1>
                            <div  className="section_background-wrap">
                                <canvas id="gradient-canvas" data-js-darken-top data-transition-in></canvas>
                            </div>
                            <div className="text text-under text-under-blended section-title-1">sdvd</div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </section>
    <Navbar/>
    <App />
  </ApolloProvider>
);
